import xlwt
import numpy

def array_print_excel(Array):
    book = xlwt.Workbook(encoding='utf-8',style_compression=0)
    sheet = book.add_sheet('123', cell_overwrite_ok=True)
    n = len(Array)
    m = len(Array[0])
    for i in range(n):
        for j in range(m):
            sheet.write(i, j, str(Array[i][j]))
            book.save('Test.xls')

